【ドライ＆ドライアップ 引き出し・衣装ケース用の詳細】<br>
●吸った湿気がゼリー状に固まるタイプの除湿剤です。<br>
●洋服ダンスなどに吊り下げる薄型タイプです。<br>
●収納空間の気になるニオイを消臭します。（気になるニオイ＝カビ臭・汗臭・体臭）<br>
●カビの発育を抑えます。<br>
●衣類保管時の黄ばみを防ぎます。（窒素酸化物（NOX）による黄ばみ）<br>
?汚れが原因の黄ばみには効果がありません。<br>
?黄ばみを消す効果はありません。<br>
?素材、生地によって効果は異なります。<br>
●防虫剤と一緒に使えます。<br><br>

【標準除湿量（水換算）】<br>
1シートあたり約50g（温度25度、湿度80％の場合）<br><br>

【使用期間】<br>
1～4か月（同じ使用場所でも季節や湿気の状態で異なります。）使用開始後1年以内に必ず新しい商品と交換してください。<br><br>

【使用基準】<br>
タンスの引き出し・衣装ケース50Lに1シートを目安にお使いください。（容量目安サイズ（単位：cm）幅51×高さ28×奥行35）<br><br>

【使用方法】<br>
●外袋から本品を取り出し、吸湿面（白い面）を上にして、衣類の一番上に置いてください。<br>
●薬剤全体がゼリー状になったら新しい『ドライ＆ドライUP 引き出し・衣装ケース用』とお取り替えください。<br>
●密閉性の高い環境でご使用いただくと、より効果的です。<br><br>

【ご注意】<br>
○中の薬剤を取り出さないでください。<br>
○液モレする場合がありますので、薬剤袋に傷をつけたり、油（皮革用クリームなど）や洗剤などを付着させないでください。もれた液が付着すると、衣類を汚したり皮革製品を変質させます。<br>
○お子様がいたずらしないようご注意ください。<br>
○薬剤を口にした場合は、水で口の中を洗浄し、コップ1～2杯の水を飲ませてください。また、皮フに付いたり、目に入った場合は、すぐに多量の水で洗い流してください。どちらの場合も、異常があれば医師にご相談ください。<br>
○薬剤が衣類や金属などについたままにしておくと、変色・変質・サビの原因となりますので、水でよく洗い流してください。洗えない場合は、ベトつきがなくなるまで水拭きとカラ拭きを繰り返してください。<br>
○圧縮袋には使用しないでください。強く圧迫されると中身が染み出す恐れがあります。<br>
○特に湿気の多い場合、一時的に薬剤がゼリー状にならず液体がたまることがあります。また、温度や湿度が低い時には、使用中に薬剤が固まることがあります。どちらの場合も効果や品質には問題ございませんので、そのままご使用ください。<br>
○用途以外に使用しないでください。<br><br>

【成分】<br>
塩化カルシウム、保水剤、防カビ剤（ワサビ由来成分）<br><br>

【内容量】<br>
12シート<br><br>

【販売元】<br>
白元アース<br>
東京都台東区東上野2-21-14<br>
お電話：03-5681-7691<br><br>

【商品区分】<br>
日用品<br><br>

